import React from 'react';
import axios from 'axios';

class App extends React.Component{
  state = {
    isLoading: true,
    movies: []
  };

  componentDidMount(){
    axios.get('http://yts-proxy.now.sh/list_movies.json')
  }

  render() {
    const {isLoading} = this.state;
    return <div>{isLoading ? 'Loading...' : 'We are ready'}</div>;
  }
}
export default App;
